    private void initialiseMockOrders() throws InputDataValidationException, UserNotFoundException, ProductNotFoundException, ProductInsufficientQuantityOnHandException, CreateNewOrderException {
        Random rand = new Random();
        System.out.println("Mock orders..");

        // 25 DIFFERENT ORDERS
        for (int i = 1; i <= 25; i++) {
            LocalDateTime randomOrderDate = getRandomDate();

            int totalQuantity = 0;
            BigDecimal totalAmount = new BigDecimal(0);
            OrderEntity order = new OrderEntity(); 

            List<ProductEntity> productsToAdd = new ArrayList<>();

            // 3 DISTINCT LINE ITEMS EACH
            for (int x = 1; x <= 3; x++) {
                long randProductId = new Long(rand.nextInt(10) + 1);
                int randQty = rand.nextInt(2) + 1;
                ProductEntity product = productEntitySessionBeanLocal.retrieveProductByProductId(randProductId);
                if (productsToAdd.contains(product)) {
                    x--;
                    break;
                }
                productsToAdd.add(product);
                LineItemEntity lineItem = new LineItemEntity(randQty, product.getUnitPrice());
                lineItem.setProduct(product);
                lineItemEntitySessionBeanLocal.createLineItem(lineItem);
                totalQuantity += randQty;
                totalAmount = totalAmount.add(product.getUnitPrice().multiply(new BigDecimal(randQty)));
                order.getLineItems().add(lineItem);
            }

            order.setTotalOrderItem(3);
            order.setTotalQuantity(totalQuantity);
            order.setTotalAmount(totalAmount);
            order.setTransactionDateTime(randomOrderDate);
            orderEntitySessionBeanLocal.createNewOrder(new Long(i), order);
        }

    }

    private void initialiseRewards() throws InputDataValidationException, CreateNewRewardException, RewardNotFoundException, UpdateRewardException, UserNotFoundException {
        RewardEnum[] rewards = RewardEnum.values();
        System.out.println("Init rewards..");

        List<StaffEntity> listOfStaff = staffEntitySessionBeanLocal.retrieveAllStaffs();
        List<UserEntity> listOfCustomers = userEntitySessionBeanLocal.retrieveAllUsers()
                .stream()
                .filter(user -> user.getRole().equals(RoleEnum.CUSTOMER))
                .collect(Collectors.toList());

        for (int i = 0; i < 60; i++) {
            Instant startDate = Instant.now().minus(Duration.ofDays(1 * 30));
            Instant expiryDate = Instant.now().plus(Duration.ofDays(1 * 30));

            Instant date = between(startDate, expiryDate);
            ZoneOffset zoneOffSet = ZoneOffset.of("+08:00");
            LocalDateTime randomDate = LocalDateTime.ofInstant(date, zoneOffSet);

            Date randomRewardDate = java.util.Date
                    .from(randomDate.atZone(ZoneId.systemDefault())
                            .toInstant());

            RewardEntity reward = new RewardEntity();
            RewardEnum randomTypeOfReward = rewards[new Random().nextInt(rewards.length)];
            reward.setRewardEnum(randomTypeOfReward);
            Boolean notExpired = expiryDate.isAfter(Instant.now());
            String expiredOrNot = notExpired ? "" : " (EXPIRED)";
            reward.setRewardName(randomTypeOfReward.toString().concat(expiredOrNot));

            reward.setStaff(listOfStaff.get(new Random().nextInt(listOfStaff.size())));
            reward.setExpiryDate(randomRewardDate);

            rewardEntitySessionBeanLocal.createNewRewardEntity(reward);
        }

        List<RewardEntity> listOfRewards = rewardEntitySessionBeanLocal.retrieveAllRewards();
        for (int i = 0; i < 10; i++) {
            RewardEntity rewardToBeRedeemed = listOfRewards.get(i);
            rewardToBeRedeemed.setCustomer(listOfCustomers.get(new Random().nextInt(listOfCustomers.size())));
            rewardToBeRedeemed.setRewardName(rewardToBeRedeemed.getRewardName().concat(" (REDEEMED)"));
            rewardEntitySessionBeanLocal.updateReward(rewardToBeRedeemed);
        }

        for (int i = 19; i < 30; i++) {
            RewardEntity rewardToBeExpired = listOfRewards.get(i);

            Instant startDate = Instant.now().minus(Duration.ofDays(1 * 300));
            Instant expiryDate = Instant.now().minus(Duration.ofDays(1 * 1));

            Instant date = between(startDate, expiryDate);
            ZoneOffset zoneOffSet = ZoneOffset.of("+08:00");
            LocalDateTime randomDate = LocalDateTime.ofInstant(date, zoneOffSet);

            Date randomRewardDate = java.util.Date
                    .from(randomDate.atZone(ZoneId.systemDefault())
                            .toInstant());
            Boolean notExpired = expiryDate.isAfter(Instant.now());
            String expiredOrNot = notExpired ? "" : " (EXPIRED)";
            rewardToBeExpired.setRewardName(rewardToBeExpired.getRewardEnum().toString().concat(expiredOrNot));
            rewardEntitySessionBeanLocal.updateReward(rewardToBeExpired);
        }

        for (int i = 11; i < 16; i++) {
            RewardEntity rewardRedeemedByUser = listOfRewards.get(i);

            rewardRedeemedByUser.setRewardName(rewardRedeemedByUser.getRewardEnum().toString().concat(" (REDEEMED)"));
            UserEntity user5 = userEntitySessionBeanLocal.retrieveUserByUserId(Long.valueOf(5));
            rewardRedeemedByUser.setCustomer(user5);
            rewardEntitySessionBeanLocal.updateReward(rewardRedeemedByUser);
        }

    }

    private void initialiseDisputes() throws UserUsernameExistException, StaffUsernameExistException, UnknownPersistenceException, InputDataValidationException, StaffNotFoundException, OrderNotFoundException, CreateNewDisputeException {
        System.out.println("Init Disputes..");

        List<StaffEntity> listOfStaff = staffEntitySessionBeanLocal.retrieveAllStaffs();

        List<OrderEntity> listOfOrder = orderEntitySessionBeanLocal.retrieveAllOrders();

        for (int i = 1; i < listOfOrder.size(); i++) {
            DisputeStatusEnum[] disputes = DisputeStatusEnum.values();
            DisputeEntity disputeToMake = new DisputeEntity();
            disputeToMake.setTitle("Dispute " + i);
            disputeToMake.setDescription("description" + i);
            disputeToMake.setDisputeStatus(disputes[new Random().nextInt(2)]);
            disputeEntitySessionBeanLocal.createNewDispute(disputeToMake, null, listOfOrder.get(i).getOrderId());
//            new Random().nextInt(listOfStaff.size()%5)
        }
    }

    private void initialiseCCs() throws InputDataValidationException, CreateNewCreditCardException, UserNotFoundException, UpdateUserException, AdvertiserEntityNotFoundException {
        System.out.println("Init CCs..");

        int i = 1;
        String ccNum = "4234 6767 5767 44";
        String ccNum2 = "1254 4325 7586 86";
        String cvv = "12";
        String cvv2 = "54";

        List<UserEntity> listOfSeller = userEntitySessionBeanLocal.retrieveAllUsers();
        List<AdvertiserEntity> listOfAdvertisers = advertiserEntitySessionBeanLocal.retrieveAllAdvertiserEntity();

        System.out.println("Init CC for Sellers..");
        for (UserEntity user : listOfSeller) {
            CreditCardEntity ccToMake = new CreditCardEntity();
            ccToMake.setHolderName(user.getFirstName() + " " + user.getLastName());
            ccToMake.setCreditCardNumber(ccNum + i);
            ccToMake.setCvv(cvv + i);
            ccToMake.setExpiryDate(new Date());
            ccToMake.setBillingAddress(user.getAddress());

            CreditCardEntity ccToMake2 = new CreditCardEntity();
            ccToMake2.setHolderName(user.getFirstName() + " " + user.getLastName());
            ccToMake2.setCreditCardNumber(ccNum2 + i);
            ccToMake2.setCvv(cvv2 + i);
            ccToMake2.setExpiryDate(new Date());
            ccToMake2.setBillingAddress(user.getAddress());

            ccToMake.setUser(user);
            ccToMake2.setUser(user);

            creditCardEntitySessionBeanLocal.createNewCreditCardEntity(ccToMake);
            creditCardEntitySessionBeanLocal.createNewCreditCardEntity(ccToMake2);

            // THIS COMES AFTER PERSISTING CC
            user.getCreditCards().add(ccToMake);
            user.getCreditCards().add(ccToMake2);
            userEntitySessionBeanLocal.updateUser(user);
            i++;
        }

        System.out.println("Init CC for Advertisers..");
        for (AdvertiserEntity advertiser : listOfAdvertisers) {
            CreditCardEntity ccToMake = new CreditCardEntity();
            ccToMake.setHolderName(advertiser.getCompanyName());
            ccToMake.setCreditCardNumber(ccNum + i);
            ccToMake.setCvv(cvv + i);
            ccToMake.setExpiryDate(new Date());
            ccToMake.setBillingAddress("");

            ccToMake.setAdvertiser(advertiser);

            creditCardEntitySessionBeanLocal.createNewCreditCardEntity(ccToMake);

            // THIS COMES AFTER PERSISTING CC
            advertiser.getCreditCards().add(ccToMake);
            advertiserEntitySessionBeanLocal.updateAdvertiserEntity(advertiser);
            i++;
        }
    }

